import React,{Component} from 'react';
class Landingcontent extends React.Component{
	constructor(props){
		super(props)

	}
	render(){
		return(
			<div>
			<div className="main1">
				<div className="c1">
					
				</div>
				<div className="c2">
				</div>

				<div className="c3">

				</div>


			</div>

						<div  className="footer">
			<p> Copyright 2020 Â© Cyber Intelligence House</p>
			</div>
			<style jsx>{`
					.footer{
					  position: fixed;
					  left: 0;
					  bottom: 0;
					  width: 100%;
					  
					  color: gray;
					  text-align: center;
			}
				.main1{

					display:flex;
					flex-direction:row;
					height:500px;
					margin-top:80px;
					align-items:center;
					justify-content:space-around;
					flex-wrap: wrap;
					


				}
				.c1{
					display:flex;
					margin-top:60px;
					background:white;
					height:350px;
					width:350px;
					 border: 0.5px solid gray;
					 box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
					
				}
				.c2{
					display:flex;
					width:350px;
					background:white;
					height:350px;
					 border: 0.5px solid gray;
					 margin-top:60px;
					 box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
					
				}
				.c3{
					display:flex;
					width:350px;
					background:white;
					height:350px;
					 border: 0.5px solid gray;
					 margin-top:60px;
					 box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
				}
				 @media (max-width: 1044px) {
				    .footer {
				          position: relative;
						  left: 0;
						  bottom: -200;
						  width: 100%;
						  background-color: red;
						  color: white;
						  text-align: center;
				        
				    }
				    .main1{
				    display:flex;
					flex-direction:row;
					height:1200px;
					margin-top:80px;
					align-items:center;
					justify-content:space-around;
					flex-wrap: wrap;
					
				    }

}
				`}</style>

			</div>

		)
	}
}
export default Landingcontent
